import React from 'react'

function Tdata(props) {
    return (
        <div className="table">
            <table>
                <tr>
                    <th>Country</th>
                    <th>cases</th>
                </tr>
                {props.countries.map(country => (
               <tr>
                   <td>{country.country}</td>
                   <td>{country.cases}</td>
               </tr>
           ))}
            </table>


        </div>
    )
}

export default Tdata;
